script: |
  super -f text -I q9813.spq | sort > q9813.out

inputs:
  - name: q9813.spq
    data: |
      SELECT ALL + - 1 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE - 4 * - 20 + - - col0 + + col0 + + col1 IS NOT NULL;
  - name: tab0

outputs:
  - name: q9813.out
    data: |
      -1
      -1
      -1
